import { 
    SIGN_IN, 
    SIGN_OUT,
} from './types';

const adminben1 = '10867791901399096879';
const adminben2 = '118315381336212654574';



export const signIn = (userId) => {
    if(userId === adminben1 || adminben2)
        return {
            type: SIGN_IN,
            payload: userId,
            isAdmin: true
        }
    else
        return {
            type: SIGN_IN,
            payload: userId,
            isAdmin: false
            }
};

export const signOut = () => {
    return {
        type: SIGN_OUT
    };
};
